import React, {Fragment} from "react";

const Posts = (props) => {
    const {posts} = props

    return (
        <div>
      {  posts.map(post => {
            const {description, location, price, title} = post;
            return <Fragment key={post.id}>
                    <h3>{title}</h3>
                    <p>{description}</p>
                    <p><strong>Price:</strong> {price}</p>
                    <p><strong>Location:</strong> {location}</p>
                   </Fragment>
        })}
        </div>
    )
}

export default Posts;
